import React from 'react'
import PropTypes from 'prop-types'

import StyledWrapper from './styled/StyledWrapper'

const Post = ({
  headline,
  body,
}) => {
  return (
    <StyledWrapper>
      {headline}
      {body}
    </StyledWrapper>
  )
}

Post.propTypes = {
  headline: PropTypes.string,
  body: PropTypes.string,
}

export default Post
